import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './stylle.css'
import { Link,Redirect } from 'react-router-dom';
class Indexx extends React.Component{
    constructor(props){
        super(props);
        this.state=({
            source:'',
            s1:'',
            destination:'',
            d1:''
        })
    }
      onsub=()=>{
          //alert(`${this.state.source} ${this.state.s1} ${this.state.destination} ${this.state.d1}`)
        }
      onch1=(event)=>{
          this.setState({
              source:event.target.value
          })
      }
      onch2=(event)=>{
          this.setState({
              s1:event.target.value
          })
      }
      onch3=(event)=>{
          this.setState({
              destination:event.target.value
          })
      }
      onch4=(event)=>{
          this.setState({
              d1:event.target.value
          })
      }
    render(){

        return(
            <div className="container" class="body">
                <h3>Index page</h3>
                <form onSubmit={this.onsub} method="post" class="form" >
                    <br/>
                    <label><b>Source</b></label>
                    <select name="source" onChange={this.onch1} >
                        <option value="0">-Select-</option>
                        <option value="Gsuite">Gsuite</option>
                        <option value="0365">0365</option>
                    </select>
                    <input type="text" name="s1" placeholder="enter url" onChange={this.onch2} required/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <label><b>Destination</b></label>
                    <select name="destination" onChange={this.onch3} >
                        <option value="0">-Select-</option>
                        <option value="Gsuite">Gsuite</option>
                        <option value="0365">0365</option>
                    </select>
                    <input type="text" name="d1" placeholder="enter url" onChange={this.onch4} required/><br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    if ({this.state.source}) { 
                        <Link to="/menu" >
                        <button className=" btn-primary">view List</button>
                        </Link>
                    }
                    {/* <Link to="/menu" className="ml-auto">
                        <button> View</button>                    
                  </Link> */}
                </form>
             </div>
        );
    }
}

export default Indexx;
